    if '|' in m:
        m = m.split('|')
        return f'[{m[1]}](https://ru.wikipedia.org/wiki/{m[0].replace(" ", "_")})'
    else:
        return f'[{m}](https://ru.wikipedia.org/wiki/{m.replace(" ", "_")})'


if comment != "":
        comment = re.sub(r"\[\[.*?]]", callback_replace, comment)

